import MealItem from './MealItem'
import { useEffect } from 'react';

const Meals = () => {
    useEffect(() => {
    fetch('http://localhost:3001/meals')
        .then(response => response.json())
        .then(meals => {
            console.log('Meals:', meals);
        })
        .catch(error => {
            console.error('Error fetching meals:', error);
        });
    }, []);
    return (
        <ul id="meals">
            { 
                <MealItem />
            }
        </ul>
    )
}

export default Meals
